import {
    Routes, Route
} from "react-router-dom";
import IndexHome from "./Pages/HomePage/Index";
import {useSelector} from "react-redux";
import {MESSAGES} from "./Intl/messages";
import {IntlProvider} from "react-intl";
// import AboutPage from "./Pages/AboutPage/AboutPage";
// import ContactPage from "./Pages/ContactPage/ContactPage";
// import ProjectItemPage from "./Pages/ProjectPage/ProjectItemPage";
// import ProjectPage from "./Pages/ProjectPage/ProjectPage";

const App = () => {
    const {mainIntl} = useSelector(store => store);
    return (
        <IntlProvider locale={mainIntl} messages={MESSAGES[mainIntl]}>
            <Routes>
                <Route path={"/"} element={<IndexHome/>}/>
                {/*<Route path={"/about"} element={<AboutPage/>}/>*/}
                {/*<Route path={"/project"} element={<ProjectPage/>}/>*/}
                {/*<Route path={"/project/:id"} element={<ProjectItemPage/>}/>*/}
                {/*<Route path={"/:id/"} element={<ProjectItemPage/>}/>*/}
                {/*<Route path={"/contact"} element={<ContactPage/>}/>*/}
            </Routes>
        </IntlProvider>
    );
}
export default App;
